extern crate cfd_rust;

use cfd_rust::Transaction;
use std::str::FromStr;
use std::time::Instant;

const TX: &str = "";

fn main() {
  let mut index = 0;
  while index < 100 {
    let start = Instant::now();
    let tx = Transaction::from_str(TX).expect("Fail");
    let end = start.elapsed();
    index += 1;
    println!(
      "count {:03}: {}.{:03} sec",
      index,
      end.as_secs(),
      end.subsec_millis()
    );
    if index == 100 {
      println!("txid: {}", tx.as_txid().to_hex());
    }
  }
}
